const cardData = [
  {
    title: "All About Market Caps",
    img: "/Images/61.png",
  },
  {
    title: "Using The Platform",
    img: "/Images/62.png",
  },
  {
    title: "Digital Currencies",
    img: "/Images/63.png",
  },
  {
    title: "Terminologies",
    img: "/Images/64.png",
  },
  {
    title: "Trading Techniques",
    img: "/Images/65.png",
  },
  {
    title: "Emerging Tokens",
    img: "/Images/66.png",
  },
];

export function LearnFrom() {
  return (
    <div class="grid grid-cols-2 container mx-auto gap-x-5">
      <h1 class="text-7xl col-start-1 col-span-2 text-center">
        Learn From The Best
      </h1>

      <div className="bg-green-100">
        <LearnFromCard card={cardData[0]} />
      </div>
      <div className="bg-green-100">
        <LearnFromCard card={cardData[1]} />
      </div>
      <div className="bg-green-100">
        <LearnFromCard card={cardData[2]} />
      </div>
      <div className="bg-green-100">
        <LearnFromCard card={cardData[3]} />
      </div>
      <div className="bg-green-100">
        <LearnFromCard card={cardData[4]} />
      </div>
      <div className="bg-green-100">
        <LearnFromCard card={cardData[5]} />
      </div>

      {/* <a href="">
        <img src="/Images/61.png" alt="" />
        <h2>All About Market Caps</h2>
      </a>

      <a href="">
        <img src="/Images/62.png" alt="" />
        <h2>Using The Platform</h2>
      </a> */}

      <div class="normal-line line-p6">
        <img src="/Images/Line.png" alt="" />
      </div>

      {/* <a href="">
        <img src="/Images/63.png" alt="" />
        <h2>Digital Currencies</h2>
      </a>

      <a href="">
        <img src="/Images/64.png" alt="" />
        <h2>Terminologies</h2>
      </a> */}

      <div class="normal-line line-p6">
        <img src="/Images/Line.png" alt="" />
      </div>

      {/* <a href="">
          <img src="/Images/65.png" alt="" />
          <h2>Trading Techniques</h2>
        </a>

        <a href="">
          <img src="/Images/66.png" alt="" />
          <h2>Emerging Tokens</h2>
        </a> */}
    </div>
  );
}

function LearnFromCard({ card }) {
  const { title, img } = card;

  return (
    <a href="#">
      <img src={img} alt="" />
      <h2>{title}</h2>
    </a>
  );
}
